$(document).ready(function() {
    "use strict";
    $(".se-pre-con").fadeOut("slow"), $("body").append('<div id="toTop" class="btn back-top"><span class="ti-arrow-up"></span></div>'), $(window).on("scroll", function() {
        0!==$(this).scrollTop()?$("#toTop").fadeIn(): $("#toTop").fadeOut()
    }
    ), $("#toTop").on("click", function() {
        return $("html, body").animate( {
            scrollTop: 0
        }
        , 600), !1
    }
    ), $(".datepicker").datepicker( {
        dateFormat: "yy-mm-dd"
    }
    )
}

);